import postData from "../postData.json";
import { Link } from "react-router-dom";
  
const PostThumb = (props) => {
  return (
    <Link to={{ pathname: "/Post" }} className="article"><h3>{props.title}</h3></Link>
  );
};
  
export default PostThumb;
